// client/src/components/CaseStudies.js
import React from 'react';

const CaseStudies = () => {
  return (
    <div className="page-container">
      <div className="hero">
        <h1>Case Studies</h1>
        <p>See how businesses are transforming with Nexus AI</p>
      </div>
    </div>
  );
};

export default CaseStudies;
